import React from 'react';
import { connect } from 'react-redux';



const ShowTopic = ({topic}) => {
    useEffect((e) => {
        e.preventDefault();
    }, [topic]);

    return(
        <div>
            {topic.map((subject, i) => (    
            <div key={i}>
                <p>{subject}></p>
            </div>
            ))}
        </div>
    )
}


export default ShowTopic;
